import React from "react";
import Layout from "../../layout/Layout";
import AddModulePage from "./AddModulePage";

const IndexPage = () => {
  return (
    <div>
      <Layout>
        <div className="warmup-content-wrappper">
          <div className="plan-wrapper">
            <div className="plan-table-heading">
              <h3>Course Unit List</h3>
              <div className="search-bar">
                <input
                  name="search"
                  type="text"
                  className="form-control"
                  placeholder="Search CourseUnit"
                  aria-label="search"
                  aria-describedby="search"
                  onChange={searchCourses}
                />
                <i className="fa fa-search" aria-hidden="true"></i>
              </div>
              <div className="questionTitlebtn"></div>
            </div>

            <div className="plan-table"></div>
          </div>
        </div>
        <AddModulePage />
      </Layout>
    </div>
  );
};
export default IndexPage;
